import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Login from './children/Login';
import Reg from './children/Reg';


const Navig = () => {
    return (
        <div>
            <Nav fill variant="tabs" defaultActiveKey="/Login">
      <Nav.Item>
        <Nav.Link href="/Login">Авторизация</Nav.Link>
        <Login/>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="Reg">Регистрация</Nav.Link>
      </Nav.Item>
    </Nav>
        </div>
    );
};

export default Navig;
